import React, { useState } from 'react';

// Icon components (matching the style from HomeDashboard)
const BackArrowIcon = () => (
  <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 19l-7-7 7-7" />
  </svg>
);

const PlateIcon = () => <span className="text-2xl">🍽️</span>;
const WaterIcon = () => <span className="text-2xl">💧</span>;
const CalorieIcon = () => <span className="text-2xl">🔥</span>;
const ProteinIcon = () => <span className="text-2xl">🥩</span>;
const FiberIcon = () => <span className="text-2xl">🌾</span>;
const VitaminIcon = () => <span className="text-2xl">🥬</span>;

interface NutritionPlanProps {
  onBack: () => void;
}

const NutritionPlan: React.FC<NutritionPlanProps> = ({ onBack }) => {
  const [currentMeal, setCurrentMeal] = useState('breakfast');

  // Sample nutrition data
  const nutritionData = {
    calories: { current: 850, target: 1800, unit: 'cal' },
    protein: { current: 45, target: 80, unit: 'g' },
    fiber: { current: 12, target: 25, unit: 'g' },
    water: { current: 4, target: 8, unit: 'glasses' }
  };

  const meals = {
    breakfast: {
      name: 'Breakfast',
      time: '8:00 AM',
      items: [
        { name: 'Oatmeal with berries', calories: 320, protein: 12, fiber: 8 },
        { name: 'Greek yogurt', calories: 150, protein: 15, fiber: 0 },
        { name: 'Banana', calories: 105, protein: 1, fiber: 3 }
      ],
      totalCalories: 575,
      completed: true
    },
    lunch: {
      name: 'Lunch',
      time: '12:30 PM',
      items: [
        { name: 'Grilled chicken salad', calories: 280, protein: 35, fiber: 6 },
        { name: 'Mixed greens', calories: 25, protein: 2, fiber: 2 },
        { name: 'Olive oil dressing', calories: 120, protein: 0, fiber: 0 }
      ],
      totalCalories: 425,
      completed: false
    },
    dinner: {
      name: 'Dinner',
      time: '6:30 PM',
      items: [
        { name: 'Salmon with quinoa', calories: 450, protein: 35, fiber: 8 },
        { name: 'Steamed broccoli', calories: 55, protein: 4, fiber: 5 },
        { name: 'Sweet potato', calories: 180, protein: 4, fiber: 4 }
      ],
      totalCalories: 685,
      completed: false
    },
    snacks: {
      name: 'Snacks',
      time: 'Throughout day',
      items: [
        { name: 'Almonds', calories: 160, protein: 6, fiber: 3 },
        { name: 'Apple', calories: 95, protein: 0, fiber: 4 }
      ],
      totalCalories: 255,
      completed: false
    }
  };

  const calculateProgress = (current: number, target: number) => {
    return Math.min((current / target) * 100, 100);
  };

  const getProgressColor = (progress: number) => {
    if (progress >= 80) return 'bg-green-500';
    if (progress >= 60) return 'bg-yellow-500';
    return 'bg-red-500';
  };

  return (
    <div className="min-h-screen bg-gray-50 pb-20">
      {/* Header */}
      <header className="bg-white shadow-sm border-b border-gray-200 px-4 py-3">
        <div className="flex items-center justify-between">
          <div className="flex items-center space-x-3">
            <button
              onClick={onBack}
              className="p-1 text-gray-400 hover:text-gray-600 transition-colors"
            >
              <BackArrowIcon />
            </button>
            <div className="flex items-center space-x-2">
              <PlateIcon />
              <h1 className="text-lg font-semibold text-gray-900">Today's Nutrition Plan</h1>
            </div>
          </div>
          <div className="text-sm text-gray-500">
            {new Date().toLocaleDateString('en-US', { weekday: 'long', month: 'short', day: 'numeric' })}
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="px-4 py-6">
        {/* Nutrition Progress Overview */}
        <div className="mb-6">
          <h2 className="text-lg font-semibold text-gray-900 mb-4">Today's Progress</h2>
          <div className="grid grid-cols-2 gap-4">
            <div className="bg-white rounded-lg p-4 shadow-sm">
              <div className="flex items-center space-x-2 mb-2">
                <CalorieIcon />
                <span className="text-sm font-medium text-gray-700">Calories</span>
              </div>
              <div className="flex items-baseline space-x-1">
                <span className="text-2xl font-bold text-gray-900">{nutritionData.calories.current}</span>
                <span className="text-sm text-gray-500">/ {nutritionData.calories.target} {nutritionData.calories.unit}</span>
              </div>
              <div className="mt-2">
                <div className="w-full bg-gray-200 rounded-full h-2">
                  <div 
                    className={`h-2 rounded-full ${getProgressColor(calculateProgress(nutritionData.calories.current, nutritionData.calories.target))}`}
                    style={{ width: `${calculateProgress(nutritionData.calories.current, nutritionData.calories.target)}%` }}
                  ></div>
                </div>
              </div>
            </div>

            <div className="bg-white rounded-lg p-4 shadow-sm">
              <div className="flex items-center space-x-2 mb-2">
                <ProteinIcon />
                <span className="text-sm font-medium text-gray-700">Protein</span>
              </div>
              <div className="flex items-baseline space-x-1">
                <span className="text-2xl font-bold text-gray-900">{nutritionData.protein.current}</span>
                <span className="text-sm text-gray-500">/ {nutritionData.protein.target} {nutritionData.protein.unit}</span>
              </div>
              <div className="mt-2">
                <div className="w-full bg-gray-200 rounded-full h-2">
                  <div 
                    className={`h-2 rounded-full ${getProgressColor(calculateProgress(nutritionData.protein.current, nutritionData.protein.target))}`}
                    style={{ width: `${calculateProgress(nutritionData.protein.current, nutritionData.protein.target)}%` }}
                  ></div>
                </div>
              </div>
            </div>

            <div className="bg-white rounded-lg p-4 shadow-sm">
              <div className="flex items-center space-x-2 mb-2">
                <FiberIcon />
                <span className="text-sm font-medium text-gray-700">Fiber</span>
              </div>
              <div className="flex items-baseline space-x-1">
                <span className="text-2xl font-bold text-gray-900">{nutritionData.fiber.current}</span>
                <span className="text-sm text-gray-500">/ {nutritionData.fiber.target} {nutritionData.fiber.unit}</span>
              </div>
              <div className="mt-2">
                <div className="w-full bg-gray-200 rounded-full h-2">
                  <div 
                    className={`h-2 rounded-full ${getProgressColor(calculateProgress(nutritionData.fiber.current, nutritionData.fiber.target))}`}
                    style={{ width: `${calculateProgress(nutritionData.fiber.current, nutritionData.fiber.target)}%` }}
                  ></div>
                </div>
              </div>
            </div>

            <div className="bg-white rounded-lg p-4 shadow-sm">
              <div className="flex items-center space-x-2 mb-2">
                <WaterIcon />
                <span className="text-sm font-medium text-gray-700">Hydration</span>
              </div>
              <div className="flex items-baseline space-x-1">
                <span className="text-2xl font-bold text-gray-900">{nutritionData.water.current}</span>
                <span className="text-sm text-gray-500">/ {nutritionData.water.target} {nutritionData.water.unit}</span>
              </div>
              <div className="mt-2">
                <div className="w-full bg-gray-200 rounded-full h-2">
                  <div 
                    className={`h-2 rounded-full ${getProgressColor(calculateProgress(nutritionData.water.current, nutritionData.water.target))}`}
                    style={{ width: `${calculateProgress(nutritionData.water.current, nutritionData.water.target)}%` }}
                  ></div>
                </div>
              </div>
            </div>
          </div>
        </div>

        {/* Meal Cards */}
        <div className="space-y-4">
          <h2 className="text-lg font-semibold text-gray-900 mb-4">Today's Meals</h2>
          
          {Object.entries(meals).map(([mealKey, meal]) => (
            <div 
              key={mealKey}
              className={`bg-white rounded-lg p-4 shadow-sm border-2 transition-colors ${
                meal.completed ? 'border-green-200 bg-green-50' : 'border-gray-200'
              }`}
            >
              <div className="flex items-center justify-between mb-3">
                <div>
                  <h3 className="font-semibold text-gray-900">{meal.name}</h3>
                  <p className="text-sm text-gray-500">{meal.time}</p>
                </div>
                <div className="flex items-center space-x-2">
                  <span className="text-sm font-medium text-gray-700">{meal.totalCalories} cal</span>
                  {meal.completed && (
                    <div className="w-6 h-6 bg-green-500 rounded-full flex items-center justify-center">
                      <span className="text-white text-xs">✓</span>
                    </div>
                  )}
                </div>
              </div>

              <div className="space-y-2">
                {meal.items.map((item, index) => (
                  <div key={index} className="flex items-center justify-between py-2 border-b border-gray-100 last:border-b-0">
                    <div className="flex-1">
                      <p className="text-sm font-medium text-gray-900">{item.name}</p>
                      <div className="flex space-x-4 text-xs text-gray-500">
                        <span>{item.calories} cal</span>
                        <span>{item.protein}g protein</span>
                        <span>{item.fiber}g fiber</span>
                      </div>
                    </div>
                    <button className="text-indigo-600 hover:text-indigo-700 text-sm font-medium">
                      Log
                    </button>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>

        {/* Nutrition Tips */}
        <div className="mt-6">
          <h2 className="text-lg font-semibold text-gray-900 mb-4">Today's Tips</h2>
          <div className="bg-gradient-to-r from-green-50 to-blue-50 rounded-xl p-4 border border-green-200">
            <div className="flex items-start space-x-3">
              <div className="flex-shrink-0 w-8 h-8 bg-green-100 rounded-full flex items-center justify-center">
                <VitaminIcon />
              </div>
              <div className="flex-1">
                <p className="text-sm font-medium text-gray-900 mb-1">Focus on iron-rich foods today</p>
                <p className="text-xs text-gray-600">Include spinach, lean meats, or fortified cereals to support energy levels during PMS</p>
              </div>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default NutritionPlan;
